  return (
    <div>
     <h1 className=" justify-center flex shadow-lg p-4 rounded-3xl bg-[#FED7AA] m-8 border-2 border-orange-600   ">Choose Capsule Machine</h1>
     <Carousel imageList={imagesList} textList={loremIpsumText} />
    </div>
  );
}
